Now that your crate is correctly configured in your Cargo.toml file, the only step left to setup your project is to have some Rust code in your src/lib.rs file. Browser Example The template we have gives you a quick "Hello, World" project to use for compiling into a WebAssembly library that you can use in the browser: extern crate wasm_bindgen; use wasm_bindgen::prelude::*; #[wasm_bindgen]
extern { fn alert(s: &str);
} #[wasm_bindgen]
