In lib.rs , we have the configuration for wee_alloc inside a cfg_if! macro: cfg_if! { if #[cfg(feature = "wee_alloc")] { #[global_allocator] static ALLOC: wee_alloc::WeeAlloc = wee_alloc::WeeAlloc::INIT; }
} This code block is intended to initialize wee_alloc as the global memory allocator, but only if the wee_alloc feature is enabled at compile time. The feature can be enabled by passing extra options while building: $ wasm-pack build -- --features wee_alloc or alternatively you could turn it on by default in Cargo.toml : [features]
default = ["console_error_panic_hook", "wee_alloc"]

