The #[wasm_bindgen_test] is like the normal Rust #[test] attribute , except it defines a test accessible to WebAssembly and headless web browser testing. Note : Eventually #[test] will work with WebAssembly as well! Currently though custom test frameworks are not stable. #[wasm_bindgen_test]
fn pass() { assert_eq!(1 + 1, 2);
} Here the pass function is a unit test which asserts that arithmetic works in WebAssembly like we'd expect everywhere else. If the test panics (such as the assert_eq! being false) then the test will fail, otherwise the test will succeed. The reference documentation for #[wasm_bindgen_test] should have more information about defining these tests.
